import React,{useState} from "react";
import "./Contact.css"

export default function Contact() {

//      const [data, setData] = useState({
//     fullname: "",
//     phone: "",
//     email: "",
//     subject: "",
//     message: "",})

//   const InputEvent = (event) => {
//     const { name, value } = event.target

//     setData((preVal) => {
//       return {
//         ...preVal,
//         [name]: value,
//       }
//     })
//   }

//   const formSubmit = (event) => {
//     event.preventDefault()
//     alert(
//  `My name is ${data.fullname}. 
// 	My phone number is ${data.phone}. 
// 	My email address is ${data.email}. 
// 	My Subject on  ${data.subject}. 
// 	Here is my message I want to say : ${data.message}. 
// 	`
//     )
//   }
    return (
        <>
         <section className='Contact' id='contact'>
          <div className='container top'>
          <div className='heading text-center'>
            <h4>CONTACT</h4>
            <h1>Contact With Me</h1>
          </div>

          <div className='content d_flex'>
            <div className='left'>
              <div className='box box_shodow'>
                <div className='img'>
                  <img src=""alt='' />
                </div>
                <div className='details'>
                  <h1>Nasim Alam</h1>
                  <p>React Js Devloper</p>
                  <p>I am available for work. Connect with me via and call in to my account.</p> <br />
                  <p>Phone:+917654182972</p>
                  <p>Email: alamnasim492@gmail.com</p> <br />
                  <span>FIND WITH ME</span>
                  <div className='button f_flex'>
                    <button className='btn_shadow'>
                      <a href="http://wwwgoogle.com"><i className="fab fa-whatsapp-square"></i></a>
                     
                    </button>
                    <button className='btn_shadow'>
                      <i className="fab fa-linkedin-in"></i>
                    </button>
                    <button className='btn_shadow'>
                      <i className="fab fa-github"></i>
                    </button>
                  </div>
                </div>
              </div>
            </div>

            <div className='right box_shodow'>
              <form onSubmit={formSubmit}>
                <div className='f_flex'>
                  <div className='input row'>
                    <span>YOUR NAME</span>
                    <input type='text' name='fullname'  />
                  </div>
                  <div className='input row'>
                    <span>PHONE NUMBER </span>
                    <input type='number' name='phone'  />
                  </div>
                </div>
                <div className='input'>
                  <span>EMAIL </span>
                  <input type='email' name='email'  />
                </div>
                <div className='input'>
                  <span>SUBJECT </span>
                  <input type='text' name='subject' />
                </div>
                <div className='input'>
                  <span>YOUR MESSAGE </span>
                  <textarea cols='30' rows='10' name='message' value={data.message} onChange={InputEvent}></textarea>
                </div>
                <button className='btn_shadow'>
                  SEND MESSAGE <i className='fa fa-long-arrow-right'></i>
                  <a href="mailto:alamnasim492@gmail.com"></a>
                </button>
              </form>
            </div>
          </div>
        </div>
      </section>
    </>
  )
}
